import React from "react";
import css from "@emotion/css";
const ContactInfo = ({ isProfileData }) => {
  console.log("isProfileData", isProfileData);
  const cData = isProfileData && isProfileData.profile;
  return (
    <React.Fragment>
      <div
        className="p-4"
        css={css`
          margin-top: -10px;
          margin-bottom: 0px;
        `}
      >
        {cData &&
          cData.length > 0 &&
          cData.map((contactDets) => (
            <p>
              <span>email: {contactDets.email}</span>
              <span>Mobile Number: {contactDets.mobileNumber}</span>
            </p>
          ))}
      </div>
    </React.Fragment>
  );
};

export default ContactInfo;
